import styled from "styled-components";

export const Button1 = styled.button`
    outline: none;
    display: flex;
    justify-content: center;
    align-items: center;
    transition: all .4s ease;
    &:hover {
      color: #fff !important;
      background: #EA7C69 !important;
      boxShadow: 0px 8px 24px rgba(234, 124, 105, 0.3) !important;
    },
`;
